import React from 'react';
import Nav from './navTrainee';
import Profile from'../../assets/profileIcon.png';
const editProfile = () => {
  return (
    <div>
        <Nav />
        <div className='Container md-auto'>
            <img src={Profile} id='imgProfile' alt='Change Profile' />
        </div>
    </div>
  )
}

export default editProfile
